Game::Game( MainWindow& wnd )
	:
	wnd( wnd ),
	gfx( wnd )
{
	std::random_device rd;
	std::mt19937 rng(rd());
	std::uniform_int_distribution<int> xDist(100, 700);
	std::uniform_int_distribution<int> yDist(100, 550);
	rupee0.x = xDist(rng);
	rupee0.y = yDist(rng);
	rupee1.x = xDist(rng);
	rupee1.y = yDist(rng);
	rupee2.x = xDist(rng);
	rupee2.y = yDist(rng);
	rupee3.x = xDist(rng);
	rupee3.y = yDist(rng);
	rupee4.x = xDist(rng);
	rupee4.y = yDist(rng);
	rupee5.x = xDist(rng);
	rupee5.y = yDist(rng);


	bat0.x = xDist(rng);
	bat0.y = yDist(rng);
	bat1.x = xDist(rng);
	bat1.y = yDist(rng);
	bat2.x = xDist(rng);
	bat2.y = yDist(rng);
	bat3.x = xDist(rng);
	bat3.y = yDist(rng);

	block0.x = 200;
	block0.y = 200;

	block1.x = 600;
	block1.y = 200;

	block2.x = 200;
	block2.y = 400;

	block3.x = 600;
	block3.y = 400;

	bat0.vx = 3;
	bat0.vy = 2;
	bat1.vx = -1;
	bat1.vy = 2;
	bat2.vx = 3;
	bat2.vy = -4;
	bat3.vx = 1;
	bat3.vy = -2;

	link.x = 100;
	link.y = 200;
	

//	block0.x = 500;
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	if (isStarted && !GameOver )
	{
		//Controls//
		if (wnd.kbd.KeyIsPressed(VK_SPACE))
		{
			link.speed = 3;
		}
		else
			link.speed = 1;
		if (wnd.kbd.KeyIsPressed(VK_RIGHT))
		{
			link.x += link.speed;
		}
		if (wnd.kbd.KeyIsPressed(VK_LEFT))
		{
			link.x -= link.speed;
		}
		if (wnd.kbd.KeyIsPressed(VK_DOWN))
		{
			link.y += link.speed;
		}
		if (wnd.kbd.KeyIsPressed(VK_UP))
		{
			link.y -= link.speed;
		}
		//Clamp Screen//
		link.ClampScreen();

		block1.BlockStop(link);
		block0.BlockStop( link);
		block2.BlockStop(link);
		block3.BlockStop(link);
		
		//BAT movment
		
		bat0.Update();
		bat1.Update();
		bat2.Update();
		bat3.Update();
		

		//Collision//
		bat0.Hit(link.x, link.y, link.width, link.height);
		bat1.Hit(link.x, link.y, link.width, link.height);
		bat2.Hit(link.x, link.y, link.width, link.height);
		bat3.Hit(link.x, link.y, link.width, link.height);
		rupee0.Get(link.x, link.y, link.width, link.height);
		rupee1.Get(link.x, link.y, link.width, link.height);
		rupee2.Get(link.x, link.y, link.width, link.height);
		rupee3.Get(link.x, link.y, link.width, link.height);
		rupee4.Get(link.x, link.y, link.width, link.height);
		rupee5.Get(link.x, link.y, link.width, link.height);
		}
	else
	{
		if (wnd.kbd.KeyIsPressed(VK_RETURN))
		{
			isStarted = true;
			
		}
		
	}
}



